import Unit from '../view/Units/UnitsData'
import UnitsDetails from '../view/Units/UnitsDetails'

export default function units() {

  const urlParams = new URLSearchParams(window.location.search)
  const bldg = urlParams.get('building') as string
  const unit = urlParams.get('unit') as string
  const id = urlParams.get('v') as string

  return (
    <div>
      {typeof window !== 'undefined' ? (
        <UnitsDetails
          id={id}
          building={bldg}
          unit={unit}
        />
      ) : (
        <Unit/>
      )}
    </div>
  )
}
